<>
                    {item && (<div className="gallery__item">
                        <div className={item.price}>
                        <img className="gallery__img" src={item.img} alt={item.alt}/>
                        <h3>{item.productName}</h3>
                        <p>{item.productCost}</p>
                        <p>{item.productDescription}</p>
